import './App.css'
import TopMovies from './components/top-movies/top-movies'
import Navbar from './components/navbar/navbar';
import { Route } from 'react-router-dom';

function App() {
  return (
    <>
		<Navbar/>
		<div className="App">
			<switch>
			<Route path="/top-movies">
				<TopMovies/>
				</Route>
			</switch>

		</div>
    </>
  );
}

export default App;
